contracts/PayMe.sol.content:
// SPDX-License-Identifier: MIT

// Smart contract that lets anyone deposit ETH into the contract
// Only the owner of the contract can withdraw the ETH
pragma solidity ^0.8.0;

// Get the latest ETH/USD price from chainlink price feed

// IMPORTANT: This contract has been updated to use the Goerli testnet
// Please see: https://docs.chain.link/docs/get-the-latest-price/
// For more information

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract PayMe {
    address GOERLI_TESTNET_ETH_USD = 0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e;

    address public owner;
    mapping(address => uint) public addrToAmtSpent;
    address[] public buyers;

    constructor() {
        owner = msg.sender;
    }

    function pay(uint amountUSD) 
        public 
        payable 
    {
        // US$ 1
        uint amountUSD18d = amountUSD * 10**18; // msg.value in Wei
        require(ethToUSD(msg.value) >= amountUSD18d, "Not enough balance");
        
        if (addrToAmtSpent[msg.sender] == 0) {
            buyers.push(msg.sender);
        }
        addrToAmtSpent[msg.sender] += msg.value;
    }

    function getVer()
        public 
        view 
        returns(uint) 
    {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(GOERLI_TESTNET_ETH_USD);
        return priceFeed.version();
    }

    function getRate() 
        public 
        view 
        returns(uint) 
    {
        AggregatorV3Interface priceFeed = AggregatorV3Interface(GOERLI_TESTNET_ETH_USD);
        (,int256 answer,,,) = priceFeed.latestRoundData();
        return uint(answer);
    }

    // Input ETH, Output US$
    function ethToUSD(uint ethAmt) 
        public 
        view 
        returns(uint) 
    {
        uint ethPrice = getRate();
        uint ethAmtInUsd = (ethPrice * ethAmt) / 10**8;
        return ethAmtInUsd;
    }

    modifier onlyOwnder {
        require(msg.sender == owner, "Only the owner can withdraw ETHs");
        _;
    }
    function withdraw() 
        payable onlyOwnder 
        public 
    {
        payable(msg.sender).transfer(address(this).balance);
        for (uint i=0; i < buyers.length; i++) {
            addrToAmtSpent[buyers[i]] = 0;
        }
        buyers = new address[](0);
    }

}

